import React from 'react';

export function TableHeader() {
    return (
  <thead>
    <tr>
      <th>ID#</th>
      <th>Photo</th>
      <th>First Name</th>
      <th>Last Name</th>
      <th>Email</th>
      <th>Phone</th>
    </tr>
    </thead>
    )
}
